import React from 'react';
import { View, Text } from 'react-native';

const JugadorDetalle = ({ jugador }) => {
  return (
    <View>
      <Text>{`${jugador.name.title} ${jugador.name.first} ${jugador.name.last}`}</Text>
      <Text>ID: {jugador.login.username}</Text>
      <Text>URL: {jugador.email}</Text>
    </View>
  );
};

export default JugadorDetalle;
